func minimumCost(nums []int, k int, dist int) int64 {
    n := len(nums)
    dp := make([][]int64, k+1)
    for i := range dp {
        dp[i] = make([]int64, n+1)
        for j := range dp[i] {
            dp[i][j] = 1<<63 - 1
        }
    }
    dp[0][0] = 0
    for i := 1; i <= k; i++ {
        for j := i; j <= n; j++ {
            for l := max(i-1, j-dist-1); l < j; l++ {
                dp[i][j] = min(dp[i][j], dp[i-1][l]+int64(nums[l]))
            }
        }
    }
    return dp[k][n]
}

func min(a, b int64) int64 {
    if a < b {
        return a
    }
    return b
}

func max(a, b int) int {
    if a > b {
        return a
    }
    return b
}
